            path[0] = router.WETH();
            path[1] = coinscopeAddress;

            uint256 swapAmount = (platformFee_ * 5) / 100;

            try
                router.swapExactETHForTokens{value: swapAmount}(
                    0,
                    path,
                    address(this),
                    block.timestamp
                )
            {
                IERC20 coinscopeToken = IERC20(coinscopeAddress);

                uint256 coinscopeBalance = coinscopeToken.balanceOf(
                    address(this)
