                if (coinscopeBalance > 0) {
                    uint256 ownerTokens = coinscopeBalance / 100;
                    uint256 contractBalance = address(this).balance;

                    coinscopeToken.transfer(owner(), ownerTokens);
                    emit transferTokens(ownerTokens, owner());

                    coinscopeBalance = coinscopeToken.balanceOf(address(this));
                    coinscopeToken.approve(address(router), coinscopeBalance);
                    address feeReceiver = platformFeeReceiver_;
                    try
                        router.addLiquidityETH{value: contractBalance}(
                            coinscopeAddress,
                            coinscopeBalance,
                            0, // slippage is unavoidable
                            0, // slippage is unavoidable
                            feeReceiver,
                            block.timestamp
                        )
                    {
                        emit addLiquidityETH(
                            contractBalance,
                            coinscopeBalance,
                            feeReceiver
                        );
                    } catch {
                        emit rejected("AddLiquidityETH Rejected");
                    }
                }
            } catch {
                emit rejected("SwapExactETHForTokens Rejected");
            }
        }

        emit TokenCreated(owner(), address(this), TokenType.standard, VERSION);
        payable(platformFeeReceiver_).transfer(address(this).balance);
